import React, { Component } from "react";
import axios from 'axios';
import { useParams } from 'react-router-dom';

export default class Airport extends Component {
    constructor() {
        super();
        }

        handleLocationSubmission = e => {
            e.preventDefault();
            const icao_code = e.target[0].value;
            const options = {
                url: `http://localhost:4000/metar?icao=${icao_code}`,
                method: "GET"
            }
            axios(options)
            .then(function (response) {
                console.log(`Sent user Metar data of ${icao_code}`);
                console.log(response.data);
            })
            .catch(function (err) { console.log(err); })
        };
        render() {
            const { airport } = this.props.match.params;
            return(
                <h1>Your airport is: {airport}</h1>
            );
        }
    }
